PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
SELECT DISTINCT ?university ?universityLabel ?degree ?degreeLabel WHERE {
  wd:Q76 p:P69 ?educationStatement .
  ?educationStatement ps:P69 ?university .
  ?educationStatement pq:P512 ?degree .
  ?university wdt:P31 / wdt:P279 * wd:Q3918 .
  OPTIONAL {
    ?university rdfs:label ?universityLabel .
    FILTER ( lang( ?universityLabel ) = "en" )
  }
  OPTIONAL {
    ?degree rdfs:label ?degreeLabel .
    FILTER ( lang( ?degreeLabel ) = "en" )
  }
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT DISTINCT ?type ?typeLabel WHERE {
  {
    VALUES ?property {
      wdt:P136 wdt:P135 wdt:P101 wdt:P106
    }
    wd:Q762 ?property ?type .
    {
      ?type wdt:P279 * wd:Q735 .
    } UNION {
      ?type wdt:P279 * wd:Q1792644 .
    } UNION {
      ?type wdt:P279 * wd:Q968159 .
    } UNION {
      VALUES ?artisticRole {
        wd:Q1028181 wd:Q1281618 wd:Q15296811
      }
      ?type wdt:P279 * ?artisticRole .
    }
  } UNION {
    wd:Q762 wdt:P800 ?work .
    ?work wdt:P31 ?type .
    ?type wdt:P279 * wd:Q735 .
  }
  OPTIONAL {
    ?type rdfs:label ?typeLabel FILTER ( lang( ?typeLabel ) = "en" )
  }
}

