    wd:Q79 wdt:P37 ?language .
    BIND( "official" AS ?type )
  } UNION {
    wd:Q79 wdt:P2936 ?language .
    BIND( "used" AS ?type )
  }
  OPTIONAL {
    ?language wdt:P3823 ?status .
    ?status rdfs:label ?statusLabel
    FILTER ( lang( ?statusLabel ) = "en" )
